import { Azkar } from "./DataList";

export let azkary = []
export let zikrCount = []


Azkar.content.map((zikr)=>{
    azkary.push(zikr)
    zikrCount.push(zikr.repeat)
})

console.log(zikrCount);
console.log(azkary);
